import Icon from "../../../components/Icon/Icon";
import { GlobalThemes } from "../../../ThemeManager";
import { ReactComponent as SalesBackground } from "../../../assets/SalesBackground.svg";
import "./SalesTheme.scss";
const SalesTheme = ({}: {}) => {
  return (
    <>
      <div className={"salesContainer " + GlobalThemes.Sales}>
        <div className="header">
          <div className="background">
            <svg
              viewBox="0 0 500 250"
              width="100%"
              height="100%"
              perserveAspectRatio="none"
            >
              <rect
                x="0"
                y="0"
                width="500"
                height="250"
                style="fill: var(--theme-secondary);"
              ></rect>
              <path
                style="fill: var(--theme-primary); "
                d="M 0 250 L 500 0 L 500 250 L 0 250 Z"
              ></path>
            </svg>
          </div>
          <div className="headline one">Sales Theme</div>
        </div>
      </div>
    </>
  );
};
export default SalesTheme;
